import React, { useState } from 'react';
import Icon from "react-native-vector-icons/AntDesign"
import { SafeAreaView, View, Text, ScrollView, StyleSheet } from 'react-native';
import {
    FintechContainer
} from '../Fintech/componenets/fintech1Style'

export default function Fintech1(){
    return( 
    <SafeAreaView>
     <ScrollView style={styles.container}>
         <View>
         <Icon size={24} color="#CDA360" name="back"/>
         </View>
     </ScrollView>
    </SafeAreaView>
     
    )
   
}

const styles = StyleSheet.create({
tex: {
    color: "#fff",
},
box: {
    flex:1,
    backgroundColor: "#000"
},
container: {
    backgroundColor: "#000",
    paddingTop: "25px",
    flex: 1,

} 
});
